INSERT INTO `indicadores` (`idencuesta`, `numero`, `descripcion`, `valorinferior`, `valormayor`, `minimo`, `debilidaddiscurso`, `debilidadlinkinterno`, `debilidadlinkextrerno`, `debilidadarticulosinteres`, `mensajefortaleza`) VALUES
(1, 1, 'Hábitos académicos', 11, 15, 4, 'Realiza un análisis de tus resultados académicos y como has llegado a ellos, por lo cual te invitamos a generar estrategias y nuevos hábitos que te ayuden a tener éxito académico en tu próximo semestre.', 'Para trabajar tus hábitos académicos acude a <br>\r\n<B>Mejoramiento Académico</b><br> CETEC Torre norte 7mo piso, ext. 2198 <br>http://dma.mty.itesm.mx/<br><br> <b>Mentores Académicos de Excelencia</b> http://asesoriasmaes.mty.itesm.mx/', '', 'Los siguientes articulos pueden ser de tu interés.<ul>	<li>http://www.metaaprendizaje.net/habitos-de-estudio/</li>	<li>http://noticias.universia.es/portada/noticia/2014/03/28/1091462/7-habitos-estudio-claves-triunfar-universidad.html</li>\r\n</ul>', 'Tienes estrategias para un buen rendimiento académico y estas actividades te pueden llevar al  exito académico en tu vida profesional. Recuerda que los hábitos están asociados con la constancia, sigue así.'),
(1, 2, 'Hábitos Alimenticios', 11, 15, 4, 'La percepción que tienes en cuanto a tu  alimentación podría mejorar siguiendo recomendaciones para asi tener una dieta balanceada día a día; te recomendamos revisar los siguientes enlaces.', 'Programa de Bienestar Integral para Alumnos http://tecdeportes.mty.itesm.mx/index.html  \r\nDifusión Cultural http://www.mty.itesm.mx/dae/ddc/ ', 'Fuera de nuestra institución podrás encontrar las siguientes instituciones: CONARTE, Consejo para la Cultura y las Artes de Nuevo León.  www.conarte.org.mx  \r\nInstituto Estatal de Cultura Física y Deporte \r\nindenl.gob.mx/', 'http://www.salud180.com/nutricion-y-ejercicio/5-consejos-para-mejorar-tus-habitos-alimentarios-0 https://habitualmente.com/habitos-alimenticios/', 'Continua con  tus  rutinas de alimentación  para  tener una vida saludable. Recuerda que la alimentación forma parte de nuestro bienestar integral.'),
(1, 3, 'Apoyo familiar', 11, 15, 4, 'La familia es una de las redes de apoyo más importante con la que contamos todos, te invitamos a revisar los siguientes enlaces para conocer como puedes mejorar tu relación con ellos. \r\n', 'Mejoramiento Académico  CETEC Torre norte 7mo piso, ext. 2198 http://dma.mty.itesm.mx/  \r\n\r\nAsesoría y Consejería Aulas 3 305 ext. 3516 y 3517\r\n\r\nLínea de apoyo 24hrs  018008139500 (bienestar emocional, nutricional, salud física, equilibrio financiero, legal)\r\n', '', 'Los siguientes articulos pueden ser de tu interés.•	http://www.metaaprendizaje.net/habitos-de-estudio/\r\n•	http://noticias.universia.es/portada/noticia/2014/03/28/1091462/7-habitos-estudio-claves-triunfar-universidad.html\r\n\r\n', '\r\nTu familia te brinda un buen nivel de soporte que te apoya para tus decisiones en tu vida personal y académica. Sigue fortaleciendo esa relación, será clase para tu éxito.'),
(1, 4, 'Manejo de las emociones', 11, 15, 4, 'Las emociones ejercen un papel fundamental en nuestra conducta y nuestro pensamiento, por lo cual el conocer como podemos manejarlas forma un papel importante para nuestra salud, revisa los siguientes enlaces para conocer más sobre el tema.\r\n', 'Acercate a Mejoramiento Académico  CETEC Torre norte 7mo piso, ext. 2198 http://dma.mty.itesm.mx/    \r\n\r\nAsesoría y Consejería Aulas 3 305 ext. 3516 y 3517 /Línea de apoyo 24hrs  018008139500 (bienestar emocional, nutricional, salud física, equilibrio financiero, legal)\r\n', 'Fuera de nuestra institución podrás encontrar las siguientes instituciones. Los resultados obtenidos son ajenos a nuestra institución: Unidad de Servicios Psicológicos (Facultad de Psicología, UANL)\r\nCalle Dr. Carlos Canseco 110\r\nColonia Mitras Centro. Monterrey, Nuevo León\r\nTeléfono (81) 8347 4687, 8348 1065, 2724 y 3866 http://psicologia.uanl.mx/\"\r\n', 'https://www.hifamily.es/familia-escuela-una-relacion-abocada-al-exito/\r\n', 'Demuestras un buen manejo de tus emociones y acciones, la inteligencia emocional te llevará lejos en tus éxitos tanto académicos como en tu vida personal.'),
(1, 5, 'Autocontrol', 11, 15, 4, 'Es probable que te preocupe la manera en la que respondes ante ciertos eventos; te sugerimos revisar tus dudas en los siguientes enlaces para conocer como podrías mejorar.\r\n', 'Atención psicológica en el Campus\r\n\r\nTeléfono del CAMPUS 8358 2000\r\n\r\nMejoramiento Académico  CETEC Torre norte 7mo piso, ext. 2198 http://dma.mty.itesm.mx/  \r\nAsesoría y Consejería Aulas 3 305 ext. 3516 y 3517\r\n                 \r\nLínea de apoyo 24hrs  018008139500\"\r\n\r\nTeléfono del CAMPUS 8358 2000\r\nAsesoría y Consejería Aulas 3 305 ext. 3516 y 3517\r\nMejoramiento Académico  CETEC Torre norte 7mo piso, ext. 2198 http://dma.mty.itesm.mx/                   \r\nLínea de apoyo 24hrs  018008139500\r\n', 'Fuera de nuestra institución podrás encontrar las siguientes instituciones: Unidad de Servicios Psicológicos (Facultad de Psicología, UANL)\r\nCalle Dr. Carlos Canseco 110\r\nColonia Mitras Centro. Monterrey, Nuevo León\r\nTeléfono (81) 8347 4687, 8348 1065, 2724 y 3866 http://psicologia.uanl.mx/\r\n', 'http://online-psicologia.blogspot.mx/2007/12/tcnicas-de-autocontrol.html https://www.lifeder.com/10-tecnicas-de-autocontrol/\r\n', 'Demuestras un buen nivel de autocontrol para responder antes nuevas situación de la vida y adaptación a los cambios que surgen en el ambiente. Lo cual es una habilidad importante en nuestro mundo actual cambiante. Continua fortaleciendo esta habilidad.'),
(1, 6, 'Relaciones sociales', 11, 15, 4, 'Las relaciones sociales pueden ser fundamentales para todos debido a que nos apoyan a interactuar con nuestro entorno; de acuerdo a los resultados obtenidos es probable que puedas mejorar en este aspecto revisando los siguientes enlaces.\r\n', 'Atención psicológica en el Campus  Teléfono del CAMPUS 8358 2000\r\nMejoramiento Académico  CETEC Torre norte 7mo piso, ext. 2198 http://dma.mty.itesm.mx/        \r\n\r\nAsesoría y Consejería Aulas 3 305 ext. 3516 y 3517\r\n          \r\nLínea de apoyo 24hrs  018008139500\"\r\n', 'Fuera de nuestra institución podrás encontrar las siguientes instituciones: Unidad de Servicios Psicológicos (Facultad de Psicología, UANL)\r\nCalle Dr. Carlos Canseco 110\r\nColonia Mitras Centro. Monterrey, Nuevo León\r\nTeléfono (81) 8347 4687, 8348 1065, 2724 y 3866 http://psicologia.uanl.mx/\r\n', 'https://www.muyinteresante.es/salud/articulo/las-relaciones-sociales-ayudan-a-mantener-sano-nuestro-cerebro https://girocognitivo.wordpress.com/2012/04/25/los-beneficios-de-las-relaciones-sociales-para-la-salud/ http://www.tendencias21.net/Las-buenas-relaciones-familiares-y-sociales-principal-causa-de-la-felicidad_a936.html\r\n', 'Sigues cuidando y manteniendo contacto con tus amistades, gracias a ello cuentas con una red de apoyo en tus relaciones interpersonales. Continua fortaleciendo estas relaciones serán fundamentales para mejorar en todos los aspectos de tu vida.\r\n'),
(1, 7, 'Mis emociones', 11, 15, 4, 'Las emociones ejercen un papel fundamental en nuestra conducta y nuestro pensamiento, por lo cual el conocer como podemos manejarlas forma un papel importante para nuestra salud. A continuación te mostramos algunas estrategias para poder trabajar sobre ello.\r\n', 'Atención psicológica en el Campus\r\nTeléfono del CAMPUS 8358 2000\r\nMejoramiento Académico  CETEC Torre norte 7mo piso, ext. 2198 http://dma.mty.itesm.mx/     \r\n\r\nAsesoría y Consejería Aulas 3 305 ext. 3516 y 3517\r\n              \r\nLínea de apoyo 24hrs  018008139500\"\r\n', 'Fuera de nuestra institución podrás encontrar las siguientes instituciones: Unidad de Servicios Psicológicos (Facultad de Psicología, UANL)\r\nCalle Dr. Carlos Canseco 110\r\nColonia Mitras Centro. Monterrey, Nuevo León\r\nTeléfono (81) 8347 4687, 8348 1065, 2724 y 3866 http://psicologia.uanl.mx/\r\n', 'Los siguientes artículos pueden ser de tu interes •	http://psicologaonline.es/Manejo_emociones.html\r\n•	http://vinculando.org/psicologia_psicoterapia/manejo-emociones-educacion.html\r\n\"\r\n', 'Cuentas con estrategias adecuadas para poder expresar tus emociones en la mayoría de las ocasiones, lo cuál será fundamental para poder conocer que es lo que buscas y como puedes alcanzarlo.\r\n'),
(1, 8, 'Actividades de tiempo libre', 11, 15, 4, 'Las actividades recreativas nos ayudan a tener un momento de relajación fuera de nuestras actividades rutinarias; podrías consultar información en los siguientes enlaces para generar estrategias y mejorar en este aspecto.', 'Programa de Bienestar Integral para Alumnos http://tecdeportes.mty.itesm.mx/index.html  \r\nDifusión Cultural http://www.mty.itesm.mx/dae/ddc/ ', 'Fuera de nuestra institución podrás encontrar las siguientes instituciones: CONARTE, Consejo para la Cultura y las Artes de Nuevo León.  www.conarte.org.mx  \r\nInstituto Estatal de Cultura física y Deporte \r\nindenl.gob.mx/', 'http://www.cuidandote.com.mx/actividad/los-beneficios-de-las-actividades-recreativas/ http://noticias.universia.com.ar/en-portada/noticia/2013/11/22/1065017/cuales-son-ventajas-realizar-actividad-fisica.html', 'Posees equilibrio entre tus actividades extracadémicas y tu vida académica, esta relación puede ayudarte ante las situaciones de estrés que vivas durante el semestre. Continua fortaleciendo y generando espacio para estas actividades durante toda tu vida académica.\r\n'),
(1, 9, 'Sexualidad', 11, 15, 4, 'La salud sexual es un estado de bienestar físico, mental y social en relación con la sexualidad. Requiere un enfoque positivo y respetuoso de la sexualidad y de las relaciones sexuales, así como la posibilidad de tener experiencias sexuales placenteras y seguras, libres de toda coacción, discriminación y violencia. Si tu has estado en riesgo entorno a tu salud sexual acercate a recibir información o bien orientación.\r\n', 'Atención psicológica en el Campus\r\nTeléfono del CAMPUS 8358 2000\r\n\r\nMejoramiento Académico  CETEC Torre norte 7mo piso, ext. 2198.\r\n\r\nAsesoría y Consejería Aulas 3 305 ext. 3516 y 3517\r\n\r\n', 'Puedes buscar información sobre sexualidad y tu salud sexual en :         \r\n   Consejo Estatal para la Prevención y el Control del SIDA\r\nCalle Zuazua 259 Sur Centro\r\nMonterrey Nuevo León CP 64000 Teléfono:+52 (82) 83435589\r\nCorreo: contacto@ssnl.gob.mx\r\n', 'http://www.sexualidades.com.mx/articulos/sexualidad.html \r\nhttp://www.amssac.org/biblioteca/\r\n', 'Posees autocuidado de tu sexualidad y salud sexual lo cual es esencial para una vida de bienestar saludable. Continua cuidando de ti mismo y de los demás.\r\n'),
(1, 10, 'Uso de espacios virtuales', 11, 15, 4, 'Es importante revisar la manera en que invertimos el tiempo en nuestras diversas actividades y conocer la forma más segura de hacer uso de las herramientas virtuales. Puedes consultar información en:\r\n', 'FALTA TELEFONO DE TI', 'PSIPRE\r\nLoma Larga 2524, Col. Obispado Monterrey N.L. México CP 64060\r\nTel. 8342 0000, 8401 6902 y 03 / 01800.00.MENTE (63683)\r\nhttp://www.psipre.com \r\n\r\nCentro de Integración Juvenil A.C.\r\nwww.cij.gob.mx \r\nDIRECCIÓN\r\nAv. Dr. Raul Calderón González No. 240  Col. Sertoma, entre Loma Redonda y Av. La Clínica  C.P. 64710 Monterrey, N.L.\r\nTelefonos: (81) 83 48 02 91 (81) 83 33 14 75\r\n\r\n', 'http://www.cic.mx/utiliza-los-videojuegos-de-manera-responsable-y-controlada/\r\n', 'La relación que mantienes en los espacios virtuales la utilizas de manera responsable y respetuosa. Recuerda siempre manejar tu información de forma segura y responsable.\r\n'),
(1, 11, 'Vida académica', 11, 15, 4, 'Notamos que existen aspectos de tu vida académica sobre los que puedes reflexionar y trabajar para adquirir nuevos aprendizajes, consulta más información en:\r\n', 'Mejoramiento Académico  CETEC Torre norte 7mo piso, ext. 2198\r\nAsesoría y Consejería Aulas 3 305 ext. 3516 y 3517\r\n', '', 'Los siguientes articulos pueden ser de tu interés.•	http://www.metaaprendizaje.net/habitos-de-estudio/\r\n•	http://noticias.universia.es/portada/noticia/2014/03/28/1091462/7-habitos-estudio-claves-triunfar-universidad.html\r\n\r\n', 'Las experiencias del pasado  que  has tenido durante tu trayectoria académica y los aprendizajes que te han dejado, te permiten recordarlas de manera positiva y estratégica.\r\nSigue acumulando buenas experiencias para tu vida. \r\n'),
(1, 12, 'Adaptación', 11, 15, 4, 'Encontramos que es posible que te preocupe la forma en cómo te adaptas a nuevas situaciones, podrías consultar dudas en:\r\n', 'Mejoramiento Académico  CETEC Torre norte 7mo piso, ext. 2198\r\n', 'Fuera de nuestra institución podrás encontrar las siguientes instituciones: Unidad de Servicios Psicológicos (Facultad de Psicología, UANL)\r\nCalle Dr. Carlos Canseco 110\r\nColonia Mitras Centro. Monterrey, Nuevo León\r\nTeléfono (81) 8347 4687, 8348 1065, 2724 y 3866 http://psicologia.uanl.mx/\r\n', '', 'Posees la habilidad de hacerle frente fácilmente a las nuevas experiencias que surjan en la vida. Continua revisando la forma en la que te adaptas a nuevas situaciones para fortalecer esta habilidad en ti.\r\n'),
(1, 13, 'Consumo de sustancias', 11, 15, 4, 'Actualmente es muy probable que te encuentres en una situación de riesgo vinculada al uso de sustancias, te invitamos a que puedas obtener mayor información acerca del tema en:\r\n', 'CAT Departamento de Prevención, Edificio administrativo de centrales – 2piso, http://prevencion.mty.itesm.mx/contacto.html\r\n', 'Centro de Integración Juvenil A.C.\r\nwww.cij.gob.mx \r\nDIRECCIÓN\r\nAv. Dr. Raul Calderón González No. 240  Col. Sertoma, entre Loma Redonda y Av. La Clínica  C.P. 64710 Monterrey, N.L.\r\nTelefonos: (81) 83 48 02 91 (81) 83 33 14 75\r\n', 'Biblioteca Virtual en Adicciones\r\nhttp://www.biblioteca.cij.gob.mx/ \r\n\r\n', 'Reconoces las situaciones entorno al consumo de drogas que ponen en riesgo tu salud. Poseer información acerca de lo que sucede y los riesgos que conlleva nos ayuda a continuar cuidando de nosotros mismos y de los demás.\r\n'),
(1, 14, 'Orientación sexual', 11, 15, 4, 'La orientación sexual \r\nEs un reconocimiento personal de mis atracciones, afinidades, experiencias o fantasías entorno a uno u otro sexo. Puede manifestarse en forma de comportamientos, pensamientos, fantasías o deseos sexuales, o en una combinación de estos elementos.\r\nNadie puede obligar o lastimarte por reconocer una parte de ti. Por ello si tu te sientes confundid@ o agredid@ por tu orientación sexual no dudes en acercarte a:\r\n', 'Atención psicológica en el Campus\r\nTeléfono del CAMPUS 8358 2000\r\nMejoramiento Académico  CETEC Torre norte 7mo piso, ext. 2198                              \r\n\r\nAsesoría y Consejería Aulas 3 305 ext. 3516 y 3517\r\n \r\n\r\nGrupo Estudiantil AIRE https://www.facebook.com/AIRE.MTY/\"\r\n', 'Link sobre Familia, sociedad y sexualidad AC https://www.facebook.com/familiaysociedadac/posts/1407444662627483            \r\n\r\n  CONAPRED Consejo Nacional para prevenir la discriminación http://www.conapred.org.mx/\r\n', 'http://www.amssac.org/biblioteca/definiciones-basicas/                                                                                                          http://ilga.org/es/               \r\n', 'Tienes aceptación, respeto y tolerancia entorno a tu orientación sexual y la de los otros. Continua  contribuyendo a generar un ambiente y armonía y respeto a tu alrededor.\r\n'),
(1, 15, 'Mis metas y el TEC', 11, 15, 4, 'Tus metas académicas, profesionales y personales tal vez aun no han sido claras, por lo cual se te invita a realizar un análisis a consciencia para trabajar esta área, puedes acudir a:\r\n', 'Centro de Vida y Carrera (CVC) Cetec torre norte 4° piso, https://cvc.itesm.mx/portal/page/portal/CVC/01\r\n', '\r\n', 'http://noticias.universia.es/empleo/noticia/2014/11/28/1116007/7-maneras-alcanzar-metas-profesionales.html           http://jurbys.blogspot.mx/2011/02/las-metas-personales-o-profesionales.html\r\n', 'Posees claridad en tus metas académicas y en tu elección del TEC como institución. La visión de nuestra dirección en nuestras metas tanto académicas como personales, genera el camino al éxito.\r\n'),
(1, 16, 'Autocuidado', 11, 15, 4, 'La manera en como percibes y trabajas el área relacionada a tu salud y el autocuidado que te das a ti mismo en este aspecto, no ha sido del todo claro, te recomendamos analizar algunos aspectos que pudieran fortalecerte en esta área como:', 'CAT Departamento de Prevención, Edificio administrativo de centrales – 2piso, http://prevencion.mty.itesm.mx/contacto.html                 http://www.itesm.mx/wps/wcm/connect/ITESM/Tecnologico+de+Monterrey/Preparatoria/Vida+Estudiantil/Bienestar+integral/', 'Jurisdicción Sanitaria #3 SSNL ( PASIA )\r\nAgustín Lara (Av, Chapultepec)\r\nMonterrey, Nuevo León', 'http://www.nl.gob.mx/salud', 'Cuentas con alternativas de autocuidado entorno a tu salud física. Continua reconociéndolas para generar un bienestar integral en tu persona.'),
(1, 17, 'Responsabilidad social', 11, 15, 4, 'La responsabilidad social es la manera en como te involucras, participas y propones en comunicación y bienestar para con los demás; te invitamos a seguir informandote para poder fortalecerte y proponer aspectos favorables en tu interacción con los demás, puedas acudir a:', 'Dirección de Asuntos Estudiantiles, Asuntos disciplinarios, Centro Estudiantil 2do. Piso Oficina 226, http://dae.mty.itesm.mx/ubicacion.htm        ETHOS: consulta, reporta y transforma, https://secure.ethicspoint.com/domain/media/es/gui/36326/index.html', 'http://www.responsabilidadsocial.mx/recomendado/', '<ul>\r\n<li><a href=\"http://www.elfinanciero.com.mx/opinion/la-etica-y-la-responsabilidad-social.html\" target=\"_BLANK\">El Financiero</a> </li> \r\n<li><a href=http://www.responsabilidadsocial.mx/\"  target=\"_BLANK\">Responsabilidad Social</a> </li>\r\n</ul> ', 'Las acciones que realizan los alumnos como muestra de su compromiso, como miembros dentro de una sociedad, ya sea como individuos o dentro de un grupo, es lo que nos define como persona. Continua involucrándote y participando para generar espacios de armonía en tu entorno.'),
(1, 18, 'Estrés', 11, 15, 4, 'Hemos detectado que la percepción que tienes sobre las demandas de tu medio ambiente (escuela, trabajo, familia, amigos) puede sobrepasar tus niveles de tolerancia y manejo emocional, por lo tanto te invitamos a informarte y buscar alternativas de manejo de estrés en los siguientes enlaces:\r\n', 'Atención psicológica en el Campus\r\nTeléfono del CAMPUS 8358 2000\r\n\r\nMejoramiento Académico  CETEC Torre norte 7mo piso, ext. 2198\r\nAsesoría y Consejería Aulas 3 305 ext. 3516 y 3517\r\n\r\nServicio Médico en el Campus Edificio Centrales Sur 1er piso ext. 3580/3581\r\nTeléfono de emergencias en campus: 15 51 15 51\r\n\r\n', 'Fuera de nuestra institución podrás encontrar las siguientes instituciones: CONARTE, Consejo para la Cultura y las Artes de Nuevo León.  www.conarte.org.mx  \r\nInstituto Estatal de Cultura física y Deporte \r\nindenl.gob.mx/\r\nAquí encontrarás actividades para relajarte y socializar.\r\n', 'http://www.umm.edu/health/medical/spanishency/articles/manejo-del-estres \r\n', 'Cuentas con un nivel óptimo de control de tus emociones y tu cuerpo ante situaciones de estrés, recuerda que existe el estrés positivo y negativo. Recuerda en todo momento generar estrategias que fortalecer tus habilidad al enfrentarte ante situaciones de estrés.');
INSERT INTO `mensajedetonadoras` (`encuesta`, `pregunta`, `mensaje`, `campus`) VALUES
(1, 1, 'Prueba. Entrada 3', '1'),
(1, 28, 'Tus respuestas indican que podría estar en riesgo tu integridad.\r\nSi tienes o has tenido  pensamientos sobre dañarte a ti mismo o a otros es importante buscar ayuda. <br>\r\nEN EL TEC DE MONTERREY:\r\n<ul><li>Línea de apoyo 24 horas: 01 800 813 9500\r\no bien marca desde tu celular al \r\n442295 3004.</li>\r\n<li> Atención Psicológica de 8 a 17:30\r\n(Conmutador: 8358 2000)\r\n<ul>\r\n<li>Asesoría y Consejería\r\nAulas 3-305 ext. 3516 y 3517</li>\r\n<li>Mejoramiento Académico\r\nCETEC, Torre Norte, 7.º piso\r\next. 2108 y 2198</li>\r\n</ul></li>\r\n</ul>\r\nSI ES UNA EMERGENCIA:\r\nLlama a la Línea de vida de la Secretaría de Salud en el Noreste de México:\r\n01 800 822 3737 o ve inmediatamente a la sala de emergencia del hospital más cercano.', '1');
