INSERT INTO `referenciasdebilidadesindicador` (`debilidadarticulosinteres`, `debilidadlinkextrerno`, `debilidadlinkinterno`, `debilidaddiscurso`, `descripcion`, `numero`, `idencuesta`, `campus`) VALUES
('http://www.umm.edu/health/medical/spanishency/articles/manejo-del-estres \r\n', 'Fuera de nuestra institución podrás encontrar las siguientes instituciones: CONARTE, Consejo para la Cultura y las Artes de Nuevo León.  www.conarte.org.mx  \r\nInstituto Estatal de Cultura física y Deporte \r\nindenl.gob.mx/\r\nAquí encontrarás actividades para relajarte y socializar.\r\n', 'Atención psicológica en el Campus\r\nTeléfono del CAMPUS 8358 2000\r\n\r\nMejoramiento Académico  CETEC Torre norte 7mo piso, ext. 2198\r\nAsesoría y Consejería Aulas 3 305 ext. 3516 y 3517\r\n\r\nServicio Médico en el Campus Edificio Centrales Sur 1er piso ext. 3580/3581\r\nTeléfono de emergencias en campus: 15 51 15 51\r\n\r\n', 'Hemos detectado que la percepción que tienes sobre las demandas de tu medio ambiente (escuela, trabajo, familia, amigos) puede sobrepasar tus niveles de tolerancia y manejo emocional, por lo tanto te invitamos a informarte y buscar alternativas de manejo de estrés en los siguientes enlaces:\r\n', 'Estrés', 18, 1, '2'),
('<ul>\r\n<li><a href=\"http://www.elfinanciero.com.mx/opinion/la-etica-y-la-responsabilidad-social.html\" target=\"_BLANK\">El Financiero</a> </li> \r\n<li><a href=http://www.responsabilidadsocial.mx/\"  target=\"_BLANK\">Responsabilidad Social</a> </li>\r\n</ul> ', 'http://www.responsabilidadsocial.mx/recomendado/', 'Dirección de Asuntos Estudiantiles, Asuntos disciplinarios, Centro Estudiantil 2do. Piso Oficina 226, <a href=\"https://joseramirezcimat.shinyapps.io/Rtec_final/\"> https://joseramirezcimat.shinyapps.io/Rtec_final/ </a>        ETHOS: consulta, reporta y transforma, <a href=\"https://joseramirezcimat.shinyapps.io/Rtec_final/\"> https://joseramirezcimat.shinyapps.io/Rtec_final/ </a>', 'La responsabilidad social es la manera en como te involucras, participas y propones en comunicación y bienestar para con los demás; te invitamos a seguir informandote para poder fortalecerte y proponer aspectos favorables en tu interacción con los demás, puedas acudir a:', 'Responsabilidad social', 17, 1, '2'),
('http://www.nl.gob.mx/salud', 'Jurisdicción Sanitaria #3 SSNL ( PASIA )\r\nAgustín Lara (Av, Chapultepec)\r\nMonterrey, Nuevo León', 'CAT Departamento de Prevención, Edificio administrativo de centrales – 2piso, <a href=\"https://joseramirezcimat.shinyapps.io/Rtec_final/\"> https://joseramirezcimat.shinyapps.io/Rtec_final/ </a>                 <a href=\"https://joseramirezcimat.shinyapps.io/Rtec_final/\"> https://joseramirezcimat.shinyapps.io/Rtec_final/ </a>', 'La manera en como percibes y trabajas el área relacionada a tu salud y el autocuidado que te das a ti mismo en este aspecto, no ha sido del todo claro, te recomendamos analizar algunos aspectos que pudieran fortalecerte en esta área como:', 'Autocuidado', 16, 1, '2'),
