('', 'Fuera de nuestra institución podrás encontrar las siguientes instituciones: Unidad de Servicios Psicológicos (Facultad de Psicología, UANL)\r\nCalle Dr. Carlos Canseco 110\r\nColonia Mitras Centro. Monterrey, Nuevo León\r\nTeléfono (81) 8347 4687, 8348 1065, 2724 y 3866 http://psicologia.uanl.mx/\r\n', 'Mejoramiento Académico  CETEC Torre norte 7mo piso, ext. 2198\r\n', 'Encontramos que es posible que te preocupe la forma en cómo te adaptas a nuevas situaciones, podrías consultar dudas en:\r\n', 'Adaptación', 12, 1, '4'),
('http://www.cic.mx/utiliza-los-videojuegos-de-manera-responsable-y-controlada/\r\n', 'PSIPRE\r\nLoma Larga 2524, Col. Obispado Monterrey N.L. México CP 64060\r\nTel. 8342 0000, 8401 6902 y 03 / 01800.00.MENTE (63683)\r\nhttp://www.psipre.com \r\n\r\nCentro de Integración Juvenil A.C.\r\nwww.cij.gob.mx \r\nDIRECCIÓN\r\nAv. Dr. Raul Calderón González No. 240  Col. Sertoma, entre Loma Redonda y Av. La Clínica  C.P. 64710 Monterrey, N.L.\r\nTelefonos: (81) 83 48 02 91 (81) 83 33 14 75\r\n\r\n', 'FALTA TELEFONO DE TI', 'Es importante revisar la manera en que invertimos el tiempo en nuestras diversas actividades y conocer la forma más segura de hacer uso de las herramientas virtuales. Puedes consultar información en:\r\n', 'Uso de espacios virtuales', 10, 1, '4'),
('http://www.sexualidades.com.mx/articulos/sexualidad.html \r\nhttp://www.amssac.org/biblioteca/\r\n', 'Puedes buscar información sobre sexualidad y tu salud sexual en :         \r\n   Consejo Estatal para la Prevención y el Control del SIDA\r\nCalle Zuazua 259 Sur Centro\r\nMonterrey Nuevo León CP 64000 Teléfono:+52 (82) 83435589\r\nCorreo: contacto@ssnl.gob.mx\r\n', 'Atención psicológica en el Campus\r\nTeléfono del CAMPUS 8358 2000\r\n\r\nMejoramiento Académico  CETEC Torre norte 7mo piso, ext. 2198.\r\n\r\nAsesoría y Consejería Aulas 3 305 ext. 3516 y 3517\r\n\r\n', 'La salud sexual es un estado de bienestar físico, mental y social en relación con la sexualidad. Requiere un enfoque positivo y respetuoso de la sexualidad y de las relaciones sexuales, así como la posibilidad de tener experiencias sexuales placenteras y seguras, libres de toda coacción, discriminación y violencia. Si tu has estado en riesgo entorno a tu salud sexual acercate a recibir información o bien orientación.\r\n', 'Sexualidad', 9, 1, '4'),
('http://www.cuidandote.com.mx/actividad/los-beneficios-de-las-actividades-recreativas/ http://noticias.universia.com.ar/en-portada/noticia/2013/11/22/1065017/cuales-son-ventajas-realizar-actividad-fisica.html', 'Fuera de nuestra institución podrás encontrar las siguientes instituciones: CONARTE, Consejo para la Cultura y las Artes de Nuevo León.  www.conarte.org.mx  \r\nInstituto Estatal de Cultura física y Deporte \r\nindenl.gob.mx/', 'Programa de Bienestar Integral para Alumnos <a href=\"https://joseramirezcimat.shinyapps.io/Rtec_final/\"> https://joseramirezcimat.shinyapps.io/Rtec_final/ </a>  \r\nDifusión Cultural <a href=\"https://joseramirezcimat.shinyapps.io/Rtec_final/\"> https://joseramirezcimat.shinyapps.io/Rtec_final/ </a>', 'Las actividades recreativas nos ayudan a tener un momento de relajación fuera de nuestras actividades rutinarias; podrías consultar información en los siguientes enlaces para generar estrategias y mejorar en este aspecto.', 'Actividades de tiempo libre', 8, 1, '4'),
('Los siguientes artículos pueden ser de tu interes •  http://psicologaonline.es/Manejo_emociones.html\r\n•  http://vinculando.org/psicologia_psicoterapia/manejo-emociones-educacion.html\r\n\"\r\n', 'Fuera de nuestra institución podrás encontrar las siguientes instituciones: Unidad de Servicios Psicológicos (Facultad de Psicología, UANL)\r\nCalle Dr. Carlos Canseco 110\r\nColonia Mitras Centro. Monterrey, Nuevo León\r\nTeléfono (81) 8347 4687, 8348 1065, 2724 y 3866 http://psicologia.uanl.mx/\r\n', 'Atención psicológica en el Campus\r\nTeléfono del CAMPUS 8358 2000\r\nMejoramiento Académico  CETEC Torre norte 7mo piso, ext. 2198 <a href=\"https://github.com/fou-foo/R-Coursera/blob/master/Regression_models/cars.md\"> https://github.com/fou-foo/R-Coursera/blob/master/Regression_models/cars.md </a>     \r\n\r\nAsesoría y Consejería Aulas 3 305 ext. 3516 y 3517\r\n              \r\nLínea de apoyo 24hrs  018008139500\"\r\n', 'Las emociones ejercen un papel fundamental en nuestra conducta y nuestro pensamiento, por lo cual el conocer como podemos manejarlas forma un papel importante para nuestra salud. A continuación te mostramos algunas estrategias para poder trabajar sobre ello.\r\n', 'Mis emociones', 7, 1, '4'),
('https://www.muyinteresante.es/salud/articulo/las-relaciones-sociales-ayudan-a-mantener-sano-nuestro-cerebro https://girocognitivo.wordpress.com/2012/04/25/los-beneficios-de-las-relaciones-sociales-para-la-salud/ http://www.tendencias21.net/Las-buenas-relaciones-familiares-y-sociales-principal-causa-de-la-felicidad_a936.html\r\n', 'Fuera de nuestra institución podrás encontrar las siguientes instituciones: Unidad de Servicios Psicológicos (Facultad de Psicología, UANL)\r\nCalle Dr. Carlos Canseco 110\r\nColonia Mitras Centro. Monterrey, Nuevo León\r\nTeléfono (81) 8347 4687, 8348 1065, 2724 y 3866 http://psicologia.uanl.mx/\r\n', 'Atención psicológica en el Campus  Teléfono del CAMPUS 8358 2000\r\nMejoramiento Académico  CETEC Torre norte 7mo piso, ext. 2198 <a href=\"https://github.com/fou-foo/R-Coursera/blob/master/DevDataProducts/mapswithleaflet.md\" > https://github.com/fou-foo/R-Coursera/blob/master/DevDataProducts/mapswithleaflet.md </a>       \r\n\r\nAsesoría y Consejería Aulas 3 305 ext. 3516 y 3517\r\n          \r\nLínea de apoyo 24hrs  018008139500\"\r\n', 'Las relaciones sociales pueden ser fundamentales para todos debido a que nos apoyan a interactuar con nuestro entorno; de acuerdo a los resultados obtenidos es probable que puedas mejorar en este aspecto revisando los siguientes enlaces.\r\n', 'Relaciones sociales', 6, 1, '4'),
('http://online-psicologia.blogspot.mx/2007/12/tcnicas-de-autocontrol.html https://www.lifeder.com/10-tecnicas-de-autocontrol/\r\n', 'Fuera de nuestra institución podrás encontrar las siguientes instituciones: Unidad de Servicios Psicológicos (Facultad de Psicología, UANL)\r\nCalle Dr. Carlos Canseco 110\r\nColonia Mitras Centro. Monterrey, Nuevo León\r\nTeléfono (81) 8347 4687, 8348 1065, 2724 y 3866 http://psicologia.uanl.mx/\r\n', 'Atención psicológica en el Campus\r\n\r\nTeléfono del CAMPUS 8358 2000\r\n\r\nMejoramiento Académico  CETEC Torre norte 7mo piso, ext. 2198 <a href=\"https://github.com/fou-foo/AdvanceR/blob/master/Visual/maps.pdf\"> https://github.com/fou-foo/AdvanceR/blob/master/Visual/maps.pdf </a>  \r\nAsesoría y Consejería Aulas 3 305 ext. 3516 y 3517\r\n                 \r\nLínea de apoyo 24hrs  018008139500\"\r\n\r\nTeléfono del CAMPUS 8358 2000\r\nAsesoría y Consejería Aulas 3 305 ext. 3516 y 3517\r\nMejoramiento Académico  CETEC Torre norte 7mo piso, ext. 2198 <a href=\"https://foufoo.shinyapps.io/projectnlp/\"> https://foufoo.shinyapps.io/projectnlp/ </a>                   \r\nLínea de apoyo 24hrs  018008139500\r\n', 'Es probable que te preocupe la manera en la que respondes ante ciertos eventos; te sugerimos revisar tus dudas en los siguientes enlaces para conocer como podrías mejorar.\r\n', 'Autocontrol', 5, 1, '4'),
('https://www.hifamily.es/familia-escuela-una-relacion-abocada-al-exito/\r\n', 'Fuera de nuestra institución podrás encontrar las siguientes instituciones. Los resultados obtenidos son ajenos a nuestra institución: Unidad de Servicios Psicológicos (Facultad de Psicología, UANL)\r\nCalle Dr. Carlos Canseco 110\r\nColonia Mitras Centro. Monterrey, Nuevo León\r\nTeléfono (81) 8347 4687, 8348 1065, 2724 y 3866 http://psicologia.uanl.mx/\"\r\n', 'Acercate a Mejoramiento Académico  CETEC Torre norte 7mo piso, ext. 2198 <a href=\"https://joseramirezcimat.shinyapps.io/DWD1/\"> https://joseramirezcimat.shinyapps.io/DWD1/ </a>    \r\n\r\nAsesoría y Consejería Aulas 3 305 ext. 3516 y 3517 /Línea de apoyo 24hrs  018008139500 (bienestar emocional, nutricional, salud física, equilibrio financiero, legal)\r\n', 'Las emociones ejercen un papel fundamental en nuestra conducta y nuestro pensamiento, por lo cual el conocer como podemos manejarlas forma un papel importante para nuestra salud, revisa los siguientes enlaces para conocer más sobre el tema.\r\n', 'Manejo de las emociones', 4, 1, '4'),
('http://www.salud180.com/nutricion-y-ejercicio/5-consejos-para-mejorar-tus-habitos-alimentarios-0 https://habitualmente.com/habitos-alimenticios/', 'Fuera de nuestra institución podrás encontrar las siguientes instituciones: CONARTE, Consejo para la Cultura y las Artes de Nuevo León.  www.conarte.org.mx  \r\nInstituto Estatal de Cultura Física y Deporte \r\nindenl.gob.mx/', 'Programa de Bienestar Integral para Alumnos <a href=\"https://foufoo.shinyapps.io/mp_kmeans_cpp/\"> https://foufoo.shinyapps.io/mp_kmeans_cpp/ </a>  \r\nDifusión Cultural <a href=\"https://fou-foo.shinyapps.io/likelihoodratiotest/\"> https://fou-foo.shinyapps.io/likelihoodratiotest/ </a> ', 'La percepción que tienes en cuanto a tu  alimentación podría mejorar siguiendo recomendaciones para asi tener una dieta balanceada día a día; te recomendamos revisar los siguientes enlaces.', 'Hábitos Alimenticios', 2, 1, '4');
