('Los siguientes articulos pueden ser de tu interés.• http://www.metaaprendizaje.net/habitos-de-estudio/\r\n• http://noticias.universia.es/portada/noticia/2014/03/28/1091462/7-habitos-estudio-claves-triunfar-universidad.html\r\n\r\n', '', 'Mejoramiento Académico  CETEC Torre norte 7mo piso, ext. 2198 <a href=\"https://github.com/fou-foo/Programacion_R/blob/master/histograma_medias.md\"> https://github.com/fou-foo/Programacion_R/blob/master/histograma_medias.md</a>  \r\n\r\nAsesoría y Consejería Aulas 3 305 ext. 3516 y 3517\r\n\r\nLínea de apoyo 24hrs  018008139500 (bienestar emocional, nutricional, salud física, equilibrio financiero, legal)\r\n', 'La familia es una de las redes de apoyo más importante con la que contamos todos, te invitamos a revisar los siguientes enlaces para conocer como puedes mejorar tu relación con ellos. \r\n', 'Apoyo familiar', 3, 1, '4'),
('Los siguientes articulos pueden ser de tu interés.<ul> <li>http://www.metaaprendizaje.net/habitos-de-estudio/</li> <li>http://noticias.universia.es/portada/noticia/2014/03/28/1091462/7-habitos-estudio-claves-triunfar-universidad.html</li>\r\n</ul>', '', 'Para trabajar tus hábitos académicos acude a <br>\r\n<B>Mejoramiento Académico</b><br> CETEC Torre norte 7mo piso, ext. 2198 <br><a href=\"https://foufoo.shinyapps.io/datalab2/\">https://foufoo.shinyapps.io/datalab2/ </a> <br><br> <b>Mentores Académicos de Excelencia</b> <a href=\"https://foufoo.shinyapps.io/app1/\"> https://foufoo.shinyapps.io/app1/</a>', 'Realiza un análisis de tus resultados académicos y como has llegado a ellos, por lo cual te invitamos a generar estrategias y nuevos hábitos que te ayuden a tener éxito académico en tu próximo semestre.', 'Hábitos académicos', 1, 1, '4'),
('http://www.umm.edu/health/medical/spanishency/articles/manejo-del-estres \r\n', 'Fuera de nuestra institución podrás encontrar las siguientes instituciones: CONARTE, Consejo para la Cultura y las Artes de Nuevo León.  www.conarte.org.mx  \r\nInstituto Estatal de Cultura física y Deporte \r\nindenl.gob.mx/\r\nAquí encontrarás actividades para relajarte y socializar.\r\n', 'Atención psicológica en el Campus\r\nTeléfono del CAMPUS 8358 2000\r\n\r\nMejoramiento Académico  CETEC Torre norte 7mo piso, ext. 2198\r\nAsesoría y Consejería Aulas 3 305 ext. 3516 y 3517\r\n\r\nServicio Médico en el Campus Edificio Centrales Sur 1er piso ext. 3580/3581\r\nTeléfono de emergencias en campus: 15 51 15 51\r\n\r\n', 'Hemos detectado que la percepción que tienes sobre las demandas de tu medio ambiente (escuela, trabajo, familia, amigos) puede sobrepasar tus niveles de tolerancia y manejo emocional, por lo tanto te invitamos a informarte y buscar alternativas de manejo de estrés en los siguientes enlaces:\r\n', 'Estrés', 18, 1, '4'),
('http://www.umm.edu/health/medical/spanishency/articles/manejo-del-estres \r\n', 'Fuera de nuestra institución podrás encontrar las siguientes instituciones: CONARTE, Consejo para la Cultura y las Artes de Nuevo León.  www.conarte.org.mx  \r\nInstituto Estatal de Cultura física y Deporte \r\nindenl.gob.mx/\r\nAquí encontrarás actividades para relajarte y socializar.\r\n', 'Atención psicológica en el Campus\r\nTeléfono del CAMPUS 8358 2000\r\n\r\nMejoramiento Académico  CETEC Torre norte 7mo piso, ext. 2198\r\nAsesoría y Consejería Aulas 3 305 ext. 3516 y 3517\r\n\r\nServicio Médico en el Campus Edificio Centrales Sur 1er piso ext. 3580/3581\r\nTeléfono de emergencias en campus: 15 51 15 51\r\n\r\n', 'Hemos detectado que la percepción que tienes sobre las demandas de tu medio ambiente (escuela, trabajo, familia, amigos) puede sobrepasar tus niveles de tolerancia y manejo emocional, por lo tanto te invitamos a informarte y buscar alternativas de manejo de estrés en los siguientes enlaces:\r\n', 'Estrés', 18, 1, '0'),
('http://www.nl.gob.mx/salud', 'Jurisdicción Sanitaria #3 SSNL ( PASIA )\r\nAgustín Lara (Av, Chapultepec)\r\nMonterrey, Nuevo León', 'CAT Departamento de Prevención, Edificio administrativo de centrales – 2piso, <a href=\"http://prevencion.mty.itesm.mx/contacto.html\"> http://prevencion.mty.itesm.mx/contacto.html </a>                 <a href=\"http://www.itesm.mx/wps/wcm/connect/ITESM/Tecnologico+de+Monterrey/Preparatoria/Vida+Estudiantil/Bienestar+integral/\" > http://www.itesm.mx/wps/wcm/connect/ITESM/Tecnologico+de+Monterrey/Preparatoria/Vida+Estudiantil/Bienestar+integral/ </a>', 'La manera en como percibes y trabajas el área relacionada a tu salud y el autocuidado que te das a ti mismo en este aspecto, no ha sido del todo claro, te recomendamos analizar algunos aspectos que pudieran fortalecerte en esta área como:', 'Autocuidado', 16, 1, '0'),
('<ul>\r\n<li><a href=\"http://www.elfinanciero.com.mx/opinion/la-etica-y-la-responsabilidad-social.html\" target=\"_BLANK\">El Financiero</a> </li> \r\n<li><a href=http://www.responsabilidadsocial.mx/\"  target=\"_BLANK\">Responsabilidad Social</a> </li>\r\n</ul> ', 'http://www.responsabilidadsocial.mx/recomendado/', 'Dirección de Asuntos Estudiantiles, Asuntos disciplinarios, Centro Estudiantil 2do. Piso Oficina 226, <a href=\"http://dae.mty.itesm.mx/ubicacion.htm\" > http://dae.mty.itesm.mx/ubicacion.htm </a>        ETHOS: consulta, reporta y transforma, <a href=\"https://secure.ethicspoint.com/domain/media/es/gui/36326/index.html\"> https://secure.ethicspoint.com/domain/media/es/gui/36326/index.html </a>', 'La responsabilidad social es la manera en como te involucras, participas y propones en comunicación y bienestar para con los demás; te invitamos a seguir informandote para poder fortalecerte y proponer aspectos favorables en tu interacción con los demás, puedas acudir a:', 'Responsabilidad social', 17, 1, '0'),
('http://noticias.universia.es/empleo/noticia/2014/11/28/1116007/7-maneras-alcanzar-metas-profesionales.html           http://jurbys.blogspot.mx/2011/02/las-metas-personales-o-profesionales.html\r\n', '\r\n', 'Centro de Vida y Carrera (CVC) Cetec torre norte 4° piso, <a href=\"https://cvc.itesm.mx/portal/page/portal/CVC/01\"> https://cvc.itesm.mx/portal/page/portal/CVC/01 </a>\r\n', 'Tus metas académicas, profesionales y personales tal vez aun no han sido claras, por lo cual se te invita a realizar un análisis a consciencia para trabajar esta área, puedes acudir a:\r\n', 'Mis metas y el TEC', 15, 1, '0'),
('Biblioteca Virtual en Adicciones\r\nhttp://www.biblioteca.cij.gob.mx/ \r\n\r\n', 'Centro de Integración Juvenil A.C.\r\nwww.cij.gob.mx \r\nDIRECCIÓN\r\nAv. Dr. Raul Calderón González No. 240  Col. Sertoma, entre Loma Redonda y Av. La Clínica  C.P. 64710 Monterrey, N.L.\r\nTelefonos: (81) 83 48 02 91 (81) 83 33 14 75\r\n', 'CAT Departamento de Prevención, Edificio administrativo de centrales – 2piso, <a href=\"http://prevencion.mty.itesm.mx/contacto.html\" > http://prevencion.mty.itesm.mx/contacto.html </a>\r\n', 'Actualmente es muy probable que te encuentres en una situación de riesgo vinculada al uso de sustancias, te invitamos a que puedas obtener mayor información acerca del tema en:\r\n', 'Consumo de sustancias', 13, 1, '0'),
