('http://www.cic.mx/utiliza-los-videojuegos-de-manera-responsable-y-controlada/\r\n', 'PSIPRE\r\nLoma Larga 2524, Col. Obispado Monterrey N.L. México CP 64060\r\nTel. 8342 0000, 8401 6902 y 03 / 01800.00.MENTE (63683)\r\nhttp://www.psipre.com \r\n\r\nCentro de Integración Juvenil A.C.\r\nwww.cij.gob.mx \r\nDIRECCIÓN\r\nAv. Dr. Raul Calderón González No. 240  Col. Sertoma, entre Loma Redonda y Av. La Clínica  C.P. 64710 Monterrey, N.L.\r\nTelefonos: (81) 83 48 02 91 (81) 83 33 14 75\r\n\r\n', 'FALTA TELEFONO DE TI', 'Es importante revisar la manera en que invertimos el tiempo en nuestras diversas actividades y conocer la forma más segura de hacer uso de las herramientas virtuales. Puedes consultar información en:\r\n', 'Uso de espacios virtuales', 10, 1, '3'),
('Los siguientes articulos pueden ser de tu interés.• http://www.metaaprendizaje.net/habitos-de-estudio/\r\n• http://noticias.universia.es/portada/noticia/2014/03/28/1091462/7-habitos-estudio-claves-triunfar-universidad.html\r\n\r\n', '', 'Mejoramiento Académico  CETEC Torre norte 7mo piso, ext. 2198\r\nAsesoría y Consejería Aulas 3 305 ext. 3516 y 3517\r\n', 'Notamos que existen aspectos de tu vida académica sobre los que puedes reflexionar y trabajar para adquirir nuevos aprendizajes, consulta más información en:\r\n', 'Vida académica', 11, 1, '3'),
('', 'Fuera de nuestra institución podrás encontrar las siguientes instituciones: Unidad de Servicios Psicológicos (Facultad de Psicología, UANL)\r\nCalle Dr. Carlos Canseco 110\r\nColonia Mitras Centro. Monterrey, Nuevo León\r\nTeléfono (81) 8347 4687, 8348 1065, 2724 y 3866 http://psicologia.uanl.mx/\r\n', 'Mejoramiento Académico  CETEC Torre norte 7mo piso, ext. 2198\r\n', 'Encontramos que es posible que te preocupe la forma en cómo te adaptas a nuevas situaciones, podrías consultar dudas en:\r\n', 'Adaptación', 12, 1, '3'),
('Biblioteca Virtual en Adicciones\r\nhttp://www.biblioteca.cij.gob.mx/ \r\n\r\n', 'Centro de Integración Juvenil A.C.\r\nwww.cij.gob.mx \r\nDIRECCIÓN\r\nAv. Dr. Raul Calderón González No. 240  Col. Sertoma, entre Loma Redonda y Av. La Clínica  C.P. 64710 Monterrey, N.L.\r\nTelefonos: (81) 83 48 02 91 (81) 83 33 14 75\r\n', 'CAT Departamento de Prevención, Edificio administrativo de centrales – 2piso, <a href=\"https://joseramirezcimat.shinyapps.io/Rtec_final/\"> https://joseramirezcimat.shinyapps.io/Rtec_final/ </a>\r\n', 'Actualmente es muy probable que te encuentres en una situación de riesgo vinculada al uso de sustancias, te invitamos a que puedas obtener mayor información acerca del tema en:\r\n', 'Consumo de sustancias', 13, 1, '3'),
('http://www.amssac.org/biblioteca/definiciones-basicas/                                                                                                          http://ilga.org/es/               \r\n', 'Link sobre Familia, sociedad y sexualidad AC https://www.facebook.com/familiaysociedadac/posts/1407444662627483            \r\n\r\n  CONAPRED Consejo Nacional para prevenir la discriminación http://www.conapred.org.mx/\r\n', 'Atención psicológica en el Campus\r\nTeléfono del CAMPUS 8358 2000\r\nMejoramiento Académico  CETEC Torre norte 7mo piso, ext. 2198                              \r\n\r\nAsesoría y Consejería Aulas 3 305 ext. 3516 y 3517\r\n \r\n\r\nGrupo Estudiantil AIRE <a href=\"https://joseramirezcimat.shinyapps.io/Rtec_final/\"> https://joseramirezcimat.shinyapps.io/Rtec_final/ </a>\r\n', 'La orientación sexual \r\nEs un reconocimiento personal de mis atracciones, afinidades, experiencias o fantasías entorno a uno u otro sexo. Puede manifestarse en forma de comportamientos, pensamientos, fantasías o deseos sexuales, o en una combinación de estos elementos.\r\nNadie puede obligar o lastimarte por reconocer una parte de ti. Por ello si tu te sientes confundid@ o agredid@ por tu orientación sexual no dudes en acercarte a:\r\n', 'Orientación sexual', 14, 1, '3'),
('http://noticias.universia.es/empleo/noticia/2014/11/28/1116007/7-maneras-alcanzar-metas-profesionales.html           http://jurbys.blogspot.mx/2011/02/las-metas-personales-o-profesionales.html\r\n', '\r\n', 'Centro de Vida y Carrera (CVC) Cetec torre norte 4° piso, <a href=\"https://joseramirezcimat.shinyapps.io/Rtec_final/\"> https://joseramirezcimat.shinyapps.io/Rtec_final/ </a>\r\n', 'Tus metas académicas, profesionales y personales tal vez aun no han sido claras, por lo cual se te invita a realizar un análisis a consciencia para trabajar esta área, puedes acudir a:\r\n', 'Mis metas y el TEC', 15, 1, '3'),
('http://www.nl.gob.mx/salud', 'Jurisdicción Sanitaria #3 SSNL ( PASIA )\r\nAgustín Lara (Av, Chapultepec)\r\nMonterrey, Nuevo León', 'CAT Departamento de Prevención, Edificio administrativo de centrales – 2piso, <a href=\"https://joseramirezcimat.shinyapps.io/Rtec_final/\"> https://joseramirezcimat.shinyapps.io/Rtec_final/ </a>                 <a href=\"https://joseramirezcimat.shinyapps.io/Rtec_final/\"> https://joseramirezcimat.shinyapps.io/Rtec_final/ </a>', 'La manera en como percibes y trabajas el área relacionada a tu salud y el autocuidado que te das a ti mismo en este aspecto, no ha sido del todo claro, te recomendamos analizar algunos aspectos que pudieran fortalecerte en esta área como:', 'Autocuidado', 16, 1, '3'),
('<ul>\r\n<li><a href=\"http://www.elfinanciero.com.mx/opinion/la-etica-y-la-responsabilidad-social.html\" target=\"_BLANK\">El Financiero</a> </li> \r\n<li><a href=http://www.responsabilidadsocial.mx/\"  target=\"_BLANK\">Responsabilidad Social</a> </li>\r\n</ul> ', 'http://www.responsabilidadsocial.mx/recomendado/', 'Dirección de Asuntos Estudiantiles, Asuntos disciplinarios, Centro Estudiantil 2do. Piso Oficina 226, <a href=\"https://joseramirezcimat.shinyapps.io/Rtec_final/\"> https://joseramirezcimat.shinyapps.io/Rtec_final/ </a>        ETHOS: consulta, reporta y transforma, <a href=\"https://joseramirezcimat.shinyapps.io/Rtec_final/\"> https://joseramirezcimat.shinyapps.io/Rtec_final/ </a>', 'La responsabilidad social es la manera en como te involucras, participas y propones en comunicación y bienestar para con los demás; te invitamos a seguir informandote para poder fortalecerte y proponer aspectos favorables en tu interacción con los demás, puedas acudir a:', 'Responsabilidad social', 17, 1, '3'),
('http://www.umm.edu/health/medical/spanishency/articles/manejo-del-estres \r\n', 'Fuera de nuestra institución podrás encontrar las siguientes instituciones: CONARTE, Consejo para la Cultura y las Artes de Nuevo León.  www.conarte.org.mx  \r\nInstituto Estatal de Cultura física y Deporte \r\nindenl.gob.mx/\r\nAquí encontrarás actividades para relajarte y socializar.\r\n', 'Atención psicológica en el Campus\r\nTeléfono del CAMPUS 8358 2000\r\n\r\nMejoramiento Académico  CETEC Torre norte 7mo piso, ext. 2198\r\nAsesoría y Consejería Aulas 3 305 ext. 3516 y 3517\r\n\r\nServicio Médico en el Campus Edificio Centrales Sur 1er piso ext. 3580/3581\r\nTeléfono de emergencias en campus: 15 51 15 51\r\n\r\n', 'Hemos detectado que la percepción que tienes sobre las demandas de tu medio ambiente (escuela, trabajo, familia, amigos) puede sobrepasar tus niveles de tolerancia y manejo emocional, por lo tanto te invitamos a informarte y buscar alternativas de manejo de estrés en los siguientes enlaces:\r\n', 'Estrés', 18, 1, '3');
INSERT INTO `referenciasindicador` (`campus`, `idencuesta`, `numero`, `descripcion`, `mensajefortaleza`) VALUES
('0', 1, 1, 'Hábitos académicos', 'Tienes estrategias para un buen rendimiento académico y estas actividades te pueden llevar al  exito académico en tu vida profesional. Recuerda que los hábitos están asociados con la constancia, sigue así.'),
('0', 1, 2, 'Hábitos Alimenticios', 'Continua con  tus  rutinas de alimentación  para  tener una vida saludable. Recuerda que la alimentación forma parte de nuestro bienestar integral.'),
('0', 1, 3, 'Apoyo familiar', '\r\nTu familia te brinda un buen nivel de soporte que te apoya para tus decisiones en tu vida personal y académica. Sigue fortaleciendo esa relación, será clase para tu éxito.'),
('0', 1, 4, 'Manejo de las emociones', 'Demuestras un buen manejo de tus emociones y acciones, la inteligencia emocional te llevará lejos en tus éxitos tanto académicos como en tu vida personal.'),
('0', 1, 5, 'Autocontrol', 'Demuestras un buen nivel de autocontrol para responder antes nuevas situación de la vida y adaptación a los cambios que surgen en el ambiente. Lo cual es una habilidad importante en nuestro mundo actual cambiante. Continua fortaleciendo esta habilidad.'),
('0', 1, 6, 'Relaciones sociales', 'Sigues cuidando y manteniendo contacto con tus amistades, gracias a ello cuentas con una red de apoyo en tus relaciones interpersonales. Continua fortaleciendo estas relaciones serán fundamentales para mejorar en todos los aspectos de tu vida.\r\n'),
('0', 1, 7, 'Mis emociones', 'Cuentas con estrategias adecuadas para poder expresar tus emociones en la mayoría de las ocasiones, lo cuál será fundamental para poder conocer que es lo que buscas y como puedes alcanzarlo.\r\n'),
('0', 1, 8, 'Actividades de tiempo libre', 'Posees equilibrio entre tus actividades extracadémicas y tu vida académica, esta relación puede ayudarte ante las situaciones de estrés que vivas durante el semestre. Continua fortaleciendo y generando espacio para estas actividades durante toda tu vida académica.\r\n'),
('0', 1, 9, 'Sexualidad', 'Posees autocuidado de tu sexualidad y salud sexual lo cual es esencial para una vida de bienestar saludable. Continua cuidando de ti mismo y de los demás.\r\n'),
('0', 1, 10, 'Uso de espacios virtuales', 'La relación que mantienes en los espacios virtuales la utilizas de manera responsable y respetuosa. Recuerda siempre manejar tu información de forma segura y responsable.\r\n'),
('0', 1, 11, 'Vida académica', 'Las experiencias del pasado  que  has tenido durante tu trayectoria académica y los aprendizajes que te han dejado, te permiten recordarlas de manera positiva y estratégica.\r\nSigue acumulando buenas experiencias para tu vida. \r\n'),
('0', 1, 12, 'Adaptación', 'Posees la habilidad de hacerle frente fácilmente a las nuevas experiencias que surjan en la vida. Continua revisando la forma en la que te adaptas a nuevas situaciones para fortalecer esta habilidad en ti.\r\n'),
('0', 1, 13, 'Consumo de sustancias', 'Reconoces las situaciones entorno al consumo de drogas que ponen en riesgo tu salud. Poseer información acerca de lo que sucede y los riesgos que conlleva nos ayuda a continuar cuidando de nosotros mismos y de los demás.\r\n'),
('0', 1, 14, 'Orientación sexual', 'Tienes aceptación, respeto y tolerancia entorno a tu orientación sexual y la de los otros. Continua  contribuyendo a generar un ambiente y armonía y respeto a tu alrededor.\r\n'),
('0', 1, 15, 'Mis metas y el TEC', 'Posees claridad en tus metas académicas y en tu elección del TEC como institución. La visión de nuestra dirección en nuestras metas tanto académicas como personales, genera el camino al éxito.\r\n'),
('0', 1, 16, 'Autocuidado', 'Cuentas con alternativas de autocuidado entorno a tu salud física. Continua reconociéndolas para generar un bienestar integral en tu persona.'),
('0', 1, 17, 'Responsabilidad social', 'Las acciones que realizan los alumnos como muestra de su compromiso, como miembros dentro de una sociedad, ya sea como individuos o dentro de un grupo, es lo que nos define como persona. Continua involucrándote y participando para generar espacios de armonía en tu entorno.'),
('0', 1, 18, 'Estrés', 'Cuentas con un nivel óptimo de control de tus emociones y tu cuerpo ante situaciones de estrés, recuerda que existe el estrés positivo y negativo. Recuerda en todo momento generar estrategias que fortalecer tus habilidad al enfrentarte ante situaciones de estrés.'),
