('3', 1, 5, 'Autocontrol', 'Demuestras un buen nivel de autocontrol para responder antes nuevas situación de la vida y adaptación a los cambios que surgen en el ambiente. Lo cual es una habilidad importante en nuestro mundo actual cambiante. Continua fortaleciendo esta habilidad.'),
('3', 1, 6, 'Relaciones sociales', 'Sigues cuidando y manteniendo contacto con tus amistades, gracias a ello cuentas con una red de apoyo en tus relaciones interpersonales. Continua fortaleciendo estas relaciones serán fundamentales para mejorar en todos los aspectos de tu vida.\r\n'),
('3', 1, 7, 'Mis emociones', 'Cuentas con estrategias adecuadas para poder expresar tus emociones en la mayoría de las ocasiones, lo cuál será fundamental para poder conocer que es lo que buscas y como puedes alcanzarlo.\r\n'),
('3', 1, 8, 'Actividades de tiempo libre', 'Posees equilibrio entre tus actividades extracadémicas y tu vida académica, esta relación puede ayudarte ante las situaciones de estrés que vivas durante el semestre. Continua fortaleciendo y generando espacio para estas actividades durante toda tu vida académica.\r\n'),
('3', 1, 9, 'Sexualidad', 'Posees autocuidado de tu sexualidad y salud sexual lo cual es esencial para una vida de bienestar saludable. Continua cuidando de ti mismo y de los demás.\r\n'),
('3', 1, 10, 'Uso de espacios virtuales', 'La relación que mantienes en los espacios virtuales la utilizas de manera responsable y respetuosa. Recuerda siempre manejar tu información de forma segura y responsable.\r\n'),
('3', 1, 11, 'Vida académica', 'Las experiencias del pasado  que  has tenido durante tu trayectoria académica y los aprendizajes que te han dejado, te permiten recordarlas de manera positiva y estratégica.\r\nSigue acumulando buenas experiencias para tu vida. \r\n'),
('3', 1, 12, 'Adaptación', 'Posees la habilidad de hacerle frente fácilmente a las nuevas experiencias que surjan en la vida. Continua revisando la forma en la que te adaptas a nuevas situaciones para fortalecer esta habilidad en ti.\r\n'),
('3', 1, 13, 'Consumo de sustancias', 'Reconoces las situaciones entorno al consumo de drogas que ponen en riesgo tu salud. Poseer información acerca de lo que sucede y los riesgos que conlleva nos ayuda a continuar cuidando de nosotros mismos y de los demás.\r\n'),
('3', 1, 14, 'Orientación sexual', 'Tienes aceptación, respeto y tolerancia entorno a tu orientación sexual y la de los otros. Continua  contribuyendo a generar un ambiente y armonía y respeto a tu alrededor.\r\n'),
('3', 1, 15, 'Mis metas y el TEC', 'Posees claridad en tus metas académicas y en tu elección del TEC como institución. La visión de nuestra dirección en nuestras metas tanto académicas como personales, genera el camino al éxito.\r\n'),
('3', 1, 16, 'Autocuidado', 'Cuentas con alternativas de autocuidado entorno a tu salud física. Continua reconociéndolas para generar un bienestar integral en tu persona.'),
('3', 1, 17, 'Responsabilidad social', 'Las acciones que realizan los alumnos como muestra de su compromiso, como miembros dentro de una sociedad, ya sea como individuos o dentro de un grupo, es lo que nos define como persona. Continua involucrándote y participando para generar espacios de armonía en tu entorno.'),
('3', 1, 18, 'Estrés', 'Cuentas con un nivel óptimo de control de tus emociones y tu cuerpo ante situaciones de estrés, recuerda que existe el estrés positivo y negativo. Recuerda en todo momento generar estrategias que fortalecer tus habilidad al enfrentarte ante situaciones de estrés.'),
('4', 1, 1, 'Hábitos académicos', 'Tienes estrategias para un buen rendimiento académico y estas actividades te pueden llevar al  exito académico en tu vida profesional. Recuerda que los hábitos están asociados con la constancia, sigue así.'),
('4', 1, 2, 'Hábitos Alimenticios', 'Continua con  tus  rutinas de alimentación  para  tener una vida saludable. Recuerda que la alimentación forma parte de nuestro bienestar integral.'),
